using System.Text.RegularExpressions;\nusing System.Web.UI;\n\npublic class TemplateParser\n{\n    public static string ParseTemplate(string templateFile, Dictionary<string, string> data)\n    {\n        var template = File.ReadAllText(templateFile);\n        var placeholders = Regex.Matches(template, @"\[(.*?)\]");\n\n        foreach (Match match in placeholders)\n        {\n            var placeholder = match.Groups[1].Value;\n            if (data.ContainsKey(placeholder))\n            {\n                template = template.Replace($"[{placeholder}]", data[placeholder]);\n            }\n        }\n\n        return template;\n    }\n}\n\npublic class CustomPage : System.Web.UI.Page\n{\n    protected override void Render(HtmlTextWriter writer)\n    {\n        var templateFile = "path/to/template.html";\n        var data = new Dictionary<string, string>\n        {\n            {"menu", "Menu content"},\n            {"content", "Page content"}\n        };\n\n        var renderedTemplate = TemplateParser.ParseTemplate(templateFile, data);\n        writer.Write(renderedTemplate);\n    }\n}